		// פונקציה המשמשת לערבוב השאלות והצגתן באופן רנדומלי
		function randomArray() {
		
			// לולאה המשנה את הסדר של השאלות באופן רנדומלי
			for (i = 0; i < arrangeArray.length; i++) {
				// הגרלת המספר באורך המערך
				rndQues = Math.floor(Math.random() * myGame.length);
		
				//קבלת תוכן המערך לצורך קביעת המיקום החדש באופן רנדומלי
				var orderNum = arrangeArray[rndQues];
		
				//העברת השאלה מהמערך הגדול למערך מתווך
				newArray[i] = myGame[orderNum];
		
				//חיתוך השאלה מהמערך הגדול
				myGame.splice(orderNum, 1);
			}
		
			//החזרת השאלות למערך המקורי
			myGame = newArray;
		
		}
		
